import React from "react";
import styled from "styled-components";
import { PagesWrap } from "../styles/Templates";
import { StartBtn, AccountBtn } from "../components/button/MainBtn";
import img1 from "../images/main/main_img1.jpg";

const MainPage = () => {
  return (
    <PagesWrap>
      <Title> Sanlio's keyring gamble </Title>
      <img src={img1} alt='산리오x롯데제과_빼빼로사진' style={{ margin: "5rem" }} />
      <StartBtn />
      <AccountBtn />
    </PagesWrap>
  );
};

const Title = styled.h1`
  font-size: 6rem;
  color: #f277ab;
  -webkit-text-stroke-width: 2px;
  -webkit-text-stroke-color: #f01d76;
`;

export default MainPage;
